import { Link } from "react-router-dom";

const DashBoardNavigator = ()=>{

    return(
        <ul className="nav nav-tabs flex-column">
            <li className="nav-item">
                <Link className="nav-link active"  >Today Recovery Details</Link>
            </li>
            <li className="nav-item">
                <Link className="nav-link active">Show Remain Recovery</Link>
            </li>
            <li className="nav-item">
                <Link className="nav-link active" >Show Report by Month</Link>
            </li>
        </ul>
    );
}

export default DashBoardNavigator;
